import React, { Component } from 'react';

class GameFooter extends Component {
    render() {
        return(
            <div style={{
                display: 'flex',
                justifyContent: 'center'
            }}>
                <h3>Game Footer</h3>
            </div>
        )
    }
}
export default GameFooter;
